description:
Studio : Marc Dorcel
Released : 09/2006 

Yasmine is a gorgeous, curvy young brunette who has decided to make all her fantasies come true. In a sumptuous villa, experienced men and women alike will help her reach the most ecstatic extremes through all sorts of perverse sexual games. THE STORY OF YASMINE is an extensive lesson in the art of giving and receiving pleasure in all its delicious and perverse forms.

